import React, {Component} from 'react';
import './LandingPage.css';

class Landing extends Component{
    render(){
        return(
            <div className="Landing">
                <img src="https://images.pexels.com/photos/237693/pexels-photo-237693.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260"alt="" id="mainImage" />
            

            </div>
        )
    }
}
export default Landing;
